import React from 'react'
import ReactDOM from 'react-dom'
import './App.css';
import WZRY from './wzry.js';

class App extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      items: [
        {
        name: "Essentials", color: "Sage", price: "$90"
        },
        {
          name: "Ami", color: "Red", price: "$160"
        },
        {
        name: "Acne Studio", color: "Navy", price: "$200"
        }
      ]

    };
  }

  render(){
    return (
      <div className = "main">
        {
          this.state.items.map(
            (wzry) => <WZRY name = {wzry.name} color={wzry.color} price={wzry.price}></WZRY>

          )
        }

      </div>
    )
  }
  }

export default App;
